var dashboardModule=new Vue({el:"#root",data:{loader:!0,pages:[],users:[]},computed:{filterPages:function(){return this.pages.length>3?this.pages.slice(0,3):this.pages}},methods:{getPages:function(){var e=this;$.ajax({type:"GET",url:BASEURL+"api/v1/pages/",data:{},dataType:"json",success:function(s){e.pages=s.data},error:function(e){console.error(e)}})},getUsers(){var e=this;$.ajax({type:"GET",url:BASEURL+"api/v1/users/",data:{},dataType:"json",success:function(s){console.log(s),e.users=s.data},error:function(e){console.error(e)}})}},mounted:function(){this.$nextTick((function(){this.getPages(),this.getUsers(),setTimeout(()=>{M.AutoInit(),this.loader=!1},3e3)}))}});